import React from 'react';
import Prisoner from './Prisoner';

const PrisonOverview = props =>  {
    return (
        <div>
            {props.prisoners.map(p => (
                <Prisoner name={p.name} skills={p.skills} availability={p.availability}  />
            ))}
        </div>
    )
};

export default PrisonOverview;
